  ngOnInit() {
  }

  generateSealArray(count, prodKey, prodType) {
    for (let i = 0; i < count; i++) {
      this.formData[prodKey].push(new CanSeal(i, null, null, prodType, null));
    }
  }

  /**
   * Clear the Can Array
   */
  clearCanArray(canKey) {
    this.formData[canKey] = [];
  }

  /**
   * Show hide print button
   */
  showHidePrint(showPrintBtn) {
      this.printEnabled = showPrintBtn;
  }

  onNext() {
    this.clearCanArray('msCan');
    this.clearCanArray('hsdCan');
    this.clearCanArray('msSpeed');
    this.printEnabled = false;

    if (this.formData.ms.isPresent) {
      this.generateSealArray(+this.formData.ms.canCount, 'msCan', 'Petrol');
    }

    if (this.formData.hsd.isPresent) {
      this.generateSealArray(+this.formData.hsd.canCount, 'hsdCan', 'Diesel');
    }

    if (this.formData.speed.isPresent) {
      this.generateSealArray(+this.formData.speed.canCount, 'speedCan', 'Speed');
    }

    this.showHidePrint(true);
  }

  onToggle(product) {
    const key = product.toLowerCase();

    this.clearCanArray(`${key}Can`);

    if (!this.formData[key].isPresent) {
      this.formData[key].invoiceDensity = null;
      this.formData[key].sampleDensity = null;
      this.formData[key].canCount = 0;
    }

    this.showHidePrint(false);
  }

  onUpdateCanData(data: CanSeal) {
    const id = data.id;
    const woodSeal = data.woodenBoxSeal;
    const alumSeal = data.aluminiumBoxSeal;
    const decantDetail = data.decantDetail;
    let canType = '';

    if (data.product === 'Petrol') {
      canType = 'msCan';
    } else if (data.product === 'Diesel') {
      canType = 'hsdCan';
    } else if (data.product === 'Speed') {
      canType = 'speedCan';
    }

    if (canType !== '') {
      this.formData[canType][id].woodenBoxSeal = woodSeal;
      this.formData[canType][id].aluminiumBoxSeal = alumSeal;
      this.formData[canType][id].decantDetail = decantDetail;
    }
  }

  formatData(data, index, productName) {
    const invoiceDate: any = new Date(data.invoiceDate);
    const decantDate: any = new Date(data.decantDate);

    return {
        'TERRITORY_NAME': data.territoryOffice + ' Territory',
        'SUPPLY_LOCATION': data.supplyLocation,
        'TERRITORY_OFFICE': data.territoryOffice,
        'RO_NAME': data.roName,
        'RO_ADDRESS': data.roAddress,
        'OIL_COMPANY_NAME': data.oilCompany,
        'PRODUCT_NAME': productName,
        'VEHICLE_NUMBER': data.vehicleNumber,
        'SAMPLE_DATE': decantDate.toLocaleDateString('en-IN'),
        'SAMPLE_TIME': decantDate.toLocaleTimeString(),
        'INVOICE_DENSITY': data[productName.toLowerCase()].invoiceDensity,
        'SAMPLE_DENSITY': data[productName.toLowerCase()].sampleDensity,
        'DECANT_DETAIL': data[`${productName.toLowerCase()}Can`][index].decantDetail,
        'ALUMINIUM_SEAL': data[`${productName.toLowerCase()}Can`][index].aluminiumBoxSeal,
        'WODDEN_SEAL': data[`${productName.toLowerCase()}Can`][index].woodenBoxSeal,
        'INVOICE_NUMBER': data.invoiceNumber,
        'INVOICE_DATE': invoiceDate.toLocaleDateString('en-IN'),
        'DEALER_NAME': data.dealerName,
        'DRIVER_NAME': data.driverName,
        'TRANSPORTER_NAME': data.transportName,
        'PLACE_DATE': `${data.roAddress.split(',')[1]} on ${decantDate.toLocaleDateString('en-IN')}`,
        'PAGE_INDEX': (index + 1)
    };
  }

  formatHtml(data, template) {
    var regExp = new RegExp(Object.keys(data).join("|"),"gi");

    return template.replace(regExp, matched => {
        return data[matched];
    });
  }

  generateDocDef (template, data) {
    var content = [];

    data.msCan.forEach((item, indx) => {
      const tempData = this.formatData(data, indx, 'MS');

      content.push(JSON.parse(this.formatHtml(tempData, template)));
      content.push({ text: '', pageBreak: 'after'});
    });

    data.hsdCan.forEach((item, indx) => {
      const tempData = this.formatData(data, indx, 'HSD');

      content.push(JSON.parse(this.formatHtml(tempData, template)));
      content.push({ text: '', pageBreak: 'after'});
    });

    data.speedCan.forEach((item, indx) => {
      const tempData = this.formatData(data, indx, 'SPEED');

      content.push(JSON.parse(this.formatHtml(tempData, template)));
      content.push({ text: '', pageBreak: 'after'});
    });

    content.pop();

    return content;
  }

  async onPrint() {
    const loading = await this.loadingCtrl.create({
      message: 'Please Wait'
    });
    var content = [];
    var pdfName = `${this.formData.invoiceNumber}_sampleSlip.pdf`;
    var docDefinition = {
      styles: {
          headerRow: {
              border: [false, false, false, false],
              alignment: 'center'
          },
          header: {
              fontSize: 15,
              bold: true
          },
          subHeader: {
              fontSize: 11
          },
          subSubHeader: {
              fontSize: 9,
          },
          undertaking: {
              fontSize: 10,
              italics: true
          },
          lKey: {
              lineHeight: 2,
              fontSize: 10,
              color: 'grey'
          },
          lValue: {
              fontSize: 11
          },
          rKey: {
              lineHeight: 2,
              fontSize: 8,
              color: 'grey'
          },
          rValue: {
              fontSize: 9
          }
      },
      content: [
      ]
    };

    await loading.present();
    content = this.generateDocDef(this.contentTemplate, {...this.formData, ...this.configData});
    docDefinition.content = content;

    this.pdfObj = pdfMake.createPdf(docDefinition);

    if (this.plt.is('cordova')) {
      this.pdfObj.getBuffer( buffer => {
        var utf8 = new Uint8Array(buffer);
        var binaryArray = utf8.buffer;
        var blob = new Blob([binaryArray], { type: 'application/pdf '});

        this.file.writeFile(this.file.dataDirectory, pdfName, blob, { replace: true}).then(fileEntry => {
          loading.dismiss();
          this.fileOpener.open(this.file.dataDirectory + pdfName, 'application/pdf');
        });
      });
    } else {
      loading.dismiss();
      this.pdfObj.download();
    }

    // const pdfPrintFrame = document.getElementById('pdfPrintFrame');
    // pdfPrintFrame['contentWindow'].postMessage({...this.formData, ...this.configData});
  }
